import React from 'react';
import '../style.css';

function Make({handleChange, value, optionName}) {
    return (
        <div>
            <form>
                <select onChange={handleChange} className="select_menu">
                        <option className="select_optionMenu" value={value}>{optionName}</option>
                </select>
            </form>
        </div>
    )
}

export default Make
